import './App.css';
import React, { Component } from 'react';
import News from './components/News.js';
import Navbar from './components/Navbar.js';
import Home from './components/Home.js';
import LoadingBar from 'react-top-loading-bar';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

export default class App extends Component {
  pagesize = 6;
  apikey = `3db3a94ddf9aa0d45c8cb0307d7d1b33`;
  
  state = {
    progress: 0,
    mode: 'light'
  };

  setProgress = (progress) => {
    console.log(`Setting progress to: ${progress}`);
    this.setState({ progress: progress });
  };

  toggle = () => {
    console.log(`Toggling mode from ${this.state.mode}`);
    if (this.state.mode === 'light') {
      this.setState({ mode: 'dark' });
      document.body.style.backgroundColor = 'rgb(35 35 39)';
      console.log('Mode changed to dark');
    } else {
      this.setState({ mode: 'light' });
      document.body.style.backgroundColor = '#f9f8ff';
      console.log('Mode changed to light');
    }
  };

  render() {
    console.log('App component rendering with mode:', this.state.mode);
    return (
      <Router>
        <div>
          <LoadingBar
            height={4}
            color='#f11946'
            progress={this.state.progress}
          />                                                                                       
          <Navbar mode={this.state.mode} toggle={this.toggle} />
        </div>
        <Routes>
          <Route exact path="/" element={
            <Home 
              mode={this.state.mode}  
              toggle={this.toggle} 
              apikey={this.apikey} 
              key="general" 
              pagesize={6} 
              country="us"  
              category="general" 
            />
          }></Route>
          <Route exact path="/home" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="general" 
              pagesize={6} 
              country="in" 
              category="general"
            />
          }></Route>
          <Route exact path="/business" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="business" 
              pagesize={6} 
              country="in" 
              category="business"
            />
          }></Route>
          <Route exact path="/entertainment" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="entertainment" 
              pagesize={6} 
              country="in" 
              category="entertainment"
            />
          }></Route>
          <Route exact path="/general" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="general" 
              pagesize={6} 
              country="in" 
              category="general"
            />
          }></Route>
          <Route exact path="/health" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="health" 
              pagesize={6} 
              country="in" 
              category="health"
            />
          }></Route>
          <Route exact path="/science" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="science" 
              pagesize={6} 
              country="in" 
              category="science"
            />
          }></Route>
          <Route exact path="/sports" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="sports" 
              pagesize={6} 
              country="in" 
              category="sports"
            />
          }></Route>
          <Route exact path="/technology" element={ 
            <News 
              mode={this.state.mode} 
              toggle={this.toggle}  
              setProgress={this.setProgress} 
              apikey={this.apikey} 
              key="technology" 
              pagesize={6} 
              country="in" 
              category="technology"
            />
          }></Route>
        </Routes>
      </Router>
    );
  }
}
